import { Breadcrumb } from "antd";
const MenuNavibarLayout = ({ menus }) => {
  // console.log(menus);
  return (
    <Breadcrumb>
      {menus.map((menu) => (
        <Breadcrumb.Item style={{ fontSize: 20 }}>{menu}</Breadcrumb.Item>
      ))}
    </Breadcrumb>
  );
};

export default MenuNavibarLayout;
